body.value:
An exception has occurred in your Integration Flow while processing files in ITK. 
This happend during the event "${property.event}". We would advise to double check the name of the event in the flow as well as ensure that this event is enabled in SAP Ariba for exports.

The error message as well as the file which was used during this iflow have been saved at {{download_ftp}}/logdir/Log-${property.SAP_RunId}
We would suggest to enable monitoring on your iflow with a trace level and review the logs for this specific file.

Please see more details of this exception:

1) Short description of the Exception: 
${exception.message}

2) The latest message in the body, if you reached step sending to Ariba, it will contain the response with more sepcific issue:
${body}

3) Complete stacktrace of the Exception: 
${exception.stacktrace}

